import { Box, Typography } from "@mui/material";
import Navigation from "components/Navigation";
import React, { Component } from "react";
import Cards from "components/Cards";

class Home extends Component {
  render() {
    return (
      <Box
        sx={{
          height:
            "100vh" /* Use vh as a fallback for browsers that do not support Custom Properties */,
          height: "calc(var(--vh, 1vh) * 100)",
          margin: "0 auto",
          maxWidth: "30%",
          // maxWidth: "200em",
          // minHeight: "100vh",
          // minHeight: "-webkit-fill-available",
          background:
            "linear-gradient(180deg, rgba(0, 0, 0, 0.1) 0%, rgba(0, 0, 0, 0) 100%), linear-gradient(0deg, rgba(0, 0, 0, 0.4), rgba(0, 0, 0, 0.4)), url(https://pixabay.com/get/g52b000a45dc7c426c170c82896ef6b28e41d1e76c2798afed489ff0077c9582e3016c68b4427687b0f22173b55eaf2cff94a18361b5f62e5253992daac6c7c1c_1920.jpg)",
        }}
        alt="forest"
      >
        <Navigation />
        <Typography
          sx={{
            fontFamily: "Libre Baskerville",
            fontStyle: "normal",
            fontWeight: 400,
            fontSize: "98px",
            textAlign: "center",
            mt: 5,
          }}
        >
          Conquer the forest
        </Typography>
        <Typography
          sx={{
            fontStyle: "normal",
            fontWeight: 500,
            fontSize: "16px",
            textAlign: "center",
            mt: 5,
          }}
        >
          Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
          eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad
          minim veniam, quis nostrud exercitation
        </Typography>
        <Cards />
      </Box>
    );
  }
}

export default Home;
